import { IMPORT } from '@/constants/setting/import';
import { ImportService } from "../import.service";
import BrandSettingImport from '@/views/biz-modals/brand/setting/import.vue';
import { UserService } from '@/services/user.service';
import ImportTip from "./components#/import-tip";
import { MessageService } from '@/services/message.service';
export default {
  bem: {
    bHeader: 'page-header',
    bTable: 'page-table-row'
  },
  modals: {
    BrandSettingImport: BrandSettingImport
  },
  serviceInject: function serviceInject() {
    return {
      importService: ImportService,
      messageService: MessageService,
      userService: UserService
    };
  },
  rxState: function rxState() {
    return {
      shopList: this.userService.shopList$
    };
  },
  components: {
    ImportTip: ImportTip
  },
  data: function data() {
    return {
      IMPORT: IMPORT,
      selectedValue: IMPORT.SOLD_MEMBER_CARD,
      shopId: undefined
    };
  },
  methods: {
    fetchDownloadFileInfo: function fetchDownloadFileInfo() {
      this.importService.fetchDownloadFileInfo(this.selectedValue).subscribe(function (res) {
        window.open(res.url);
      });
    },
    uploadFile: function uploadFile() {
      var _this = this;

      if (!this.shopId) {
        this.messageService.error({
          content: '请选择门店'
        });
        return;
      }

      this.$modalRouter.push({
        name: 'brand-setting-import',
        props: {
          type: this.selectedValue,
          shopId: this.shopId
        },
        on: {
          success: function success() {
            _this.$router.push({
              path: '/brand/setting/import/record'
            });
          }
        }
      });
    }
  }
};
